import React, {Component} from 'react';
import {Grid, Cell, ProgressBar} from 'react-mdl';

class Skills extends Component {
  render() {
    return(
      <Grid>
        <Cell col={4}>
          <div style={{display:'flex'}}>{this.props.title1}</div>
        </Cell>
        <Cell col={4}>
          <div style={{display:'flex'}}>{this.props.title2}</div>
        </Cell>
        <Cell col={4}>
          <div style={{display:'flex'}}>{this.props.title3}</div>
        </Cell>
      </Grid>
    )
  }
}

export default Skills;
